import React from "react";
import { View, Text, Image, TouchableOpacity } from "react-native";
import style from './style.js';

export default function home({ navigation }) {
    const json = [
        {
            "Nome": "a",
            "Descrição": "1",
            "Imagem": "https://s2.glbimg.com/nvjFq8VRjyrpdQqaOeywz-5DFwY=/e.glbimg.com/og/ed/f/original/2021/08/27/captura_de_tela_2021-08-27_as_11.01.15.png"
        },
        {
            "Nome": "b",
            "Descrição": "2",
            "Imagem": ""
        },
        {
            "Nome": "c",
            "Descrição": "3",
            "Imagem": ""
        },
        {
            "Nome": "d",
            "Descrição": "4",
            "Imagem": ""
        }
    ];
    return (
        <View style={style.pag}>
            {json.map((item, index) =>
                <TouchableOpacity style={style.cards} key={index} onPress={() => { navigation.navigate("Detalhes", item) }}>
                    <Text>{item.Nome}</Text>
                    <Image style={style.image} source={require('../assets/icone.png')}></Image>
                </TouchableOpacity>
            )}
        </View>
    );
}
